"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Undescended testes (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/undescended-testes-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H114719220\">",
"      <span class=\"h1\">",
"       What are undescended testes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The testes are the ball-shaped organs that hang between a boy&rsquo;s legs, inside a skin sac called the &ldquo;scrotum.&rdquo; Before a boy is born, his testes are inside the lower part of his belly.",
"     </p>",
"     <p>",
"      Just before birth, the testes move down into the scrotum. If this does not happen, doctors call the problem undescended testes, or &ldquo;cryptorchidism.&rdquo; It can happen to 1 or both testes.",
"     </p>",
"     <p>",
"      Sometimes, 1 or both testes do not develop normally because of a problem that happens before the baby is born. Doctors call this condition &ldquo;absent testis.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H114719235\">",
"      <span class=\"h1\">",
"       How can I tell if my baby has undescended testes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most of the time, the doctor finds the problem while doing an exam on the baby soon after birth. It is more common in babies who are born earlier than normal.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H114719252\">",
"      <span class=\"h1\">",
"       How are undescended testes treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;In most cases, no treatment is needed because the testes move down to the scrotum within a few months after birth. If that does not happen, treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Injections (shots) of a hormone called hCG",
"       </li>",
"       <li>",
"        Surgery to move the testicle or testicles into the scrotum",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      These treatments can be started when the child is 6 months old. They should be done before a child is 2 years old.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H114719267\">",
"      <span class=\"h1\">",
"       Can undescended testes cause other problems?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Men who had undescended testes in childhood are more likely to have:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Cancer of the testes &ndash; Cancer of the testes is rare--even if a man had undescended testes. Still, the doctor or nurse will do exams to check for this at yearly physical exams.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Trouble getting a woman pregnant (called &ldquo;infertility&rdquo;) &ndash; This problem is more common in men who had 2 undescended testes. But most of these men are still able to get a woman pregnant.",
"       </li>",
"      </ul>",
"     </p>",
"    </div>",
