"        Early and short-lived, frequently missed",
"       </td>",
"       <td>",
"        Early and transient, and frequently missed",
"       </td>",
"       <td>",
"        Not detectable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Serum HDV RNA (by hybridization)",
"       </td>",
"       <td>",
"        Early, transient but last longer than HDAg",
"       </td>",
"       <td>",
"        Early and persistent",
"       </td>",
"       <td>",
"        Usually positive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anti-HDV, total",
"       </td>",
"       <td>",
"        Late, low titer",
"       </td>",
"       <td>",
"        Rapidly increasing titers",
"       </td>",
"       <td>",
"        High titers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anti-HDV, IgM",
"       </td>",
"       <td>",
"        Transient, may be the only marker",
"       </td>",
"       <td>",
"        Rapidly increasing and persistent titers",
"       </td>",
"       <td>",
"        Variable titers, usually high",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Liver HDAg",
"       </td>",
"       <td>",
"        Not indicated",
"       </td>",
"       <td>",
"        Positive",
"       </td>",
"       <td>",
"        Usually positive, may be negative in late stages",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
