var script_f42_58_43948=[""].join("\n");
var outline_f42_58_43948=null;
var title_f42_58_43949="Features distinguishing dissociative PTSD from other disorders";
var content_f42_58_43949=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F65750&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F65750&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Features that typically distinguish the dissociative subtype of PTSD from borderline personality disorder, bipolar disorder and schizophrenia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dissociative subtype PTSD",
"       </td>",
"       <td class=\"subtitle1\">",
"        Schizophrenia and psychotic disorders",
"       </td>",
"       <td class=\"subtitle1\">",
"        Bipolar disorder",
"       </td>",
"       <td class=\"subtitle1\">",
"        Borderline personality disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Trauma",
"        </strong>",
"       </td>",
"       <td>",
"        Typically report early onset, severe, chronic childhood trauma.",
"       </td>",
"       <td>",
"        Less likely to have severe, chronic childhood trauma.",
"       </td>",
"       <td>",
"        Less likely to have severe, chronic childhood trauma.",
"       </td>",
"       <td>",
"        Although may report a history of childhood trauma, it may be less severe or chronic than with dissociative disorders.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Dissociative symptoms",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         Typically endorse high levels (eg, DES average score high 20s or more) with intact reality testing.",
"        </p>",
"        <p>",
"         Often prefer to feel numb than to have strong feelings. May self-harm to induce a state of dissociation from traumatic experiences.",
"        </p>",
"       </td>",
"       <td>",
"        Endorse mildly high symptoms (eg, DES average score 17.6) with poor reality testing.",
"       </td>",
"       <td>",
"        Lower dissociation scores expected.",
"       </td>",
"       <td>",
"        <p>",
"         Moderate symptoms (eg, DES average in the low 20s) but significantly lower than DID with intact reality testing; may not be different from dPTSD on derealization and depersonalization, but usually lower on amnesia.",
"        </p>",
"        <p>",
"         Often find it distressing to feel numb and may self-harm to end an episode of dissociation.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Hallucinatory experiences",
"        </strong>",
"       </td>",
"       <td>",
"        In severe cases, may endorse hearing voice(s) but aware of the \"as if\" quality (\"I know they're not real but I hear a child crying as she gets yelled at\"); may experience brief periods of \"seeing\" past traumatic events in flashback; reality testing otherwise intact; auditory and visual hallucinations relate to high dissociativity/hypnotizability.",
"       </td>",
"       <td>",
"        May endorse voices without awareness of the hallucinatory quality; may have visual hallucinations without recognition they are not real; hallucinations are due to psychotic process.",
"       </td>",
"       <td>",
"        Experiences hallucinations only during episodes of psychotic mania- or depression; in psychotic depression, any voices are typically solely persecutory.",
"       </td>",
"       <td>",
"        If experiences hallucinatory experiences, they are brief, distressing and occur during stress; if endorses voices, they express patient's polarized thoughts.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Affect",
"        </strong>",
"       </td>",
"       <td>",
"        Typically experience a range of affective states including numbed and detached; severe cases may have inexplicable, rapid mood changes that may be triggered by internal or external precipitants (eg, sad to angry to helpless and afraid). Many mood shifts can occur per day; rarely complain of \"emptiness\".",
"       </td>",
"       <td>",
"        Flat and/or inappropriate affect.",
"       </td>",
"       <td>",
"        Shifts in mood state occur more slowly (take at least 12 hours to shift mood state and usually much longer than that).",
"       </td>",
"       <td>",
"        Affect is typically less modulated than in dPTSD and shifts according to external precipitants; often the most frequent affects are emptiness and intense anger.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Ability to perceive accurately and think logically",
"        </strong>",
"       </td>",
"       <td>",
"        Perceptions are generally accurate; thinking is usually logical and organized except for brief periods following traumatic intrusions or periods of intense flooding of traumatic symptoms.",
"       </td>",
"       <td>",
"        Perception may be less accurate than in dPTSD; thinking tends to be less logical and organized.",
"       </td>",
"       <td>",
"        Disturbed only during mood episodes.",
"       </td>",
"       <td>",
"        Perception tends to be distorted and thinking is less logical, particularly when stressed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Working alliance",
"        </strong>",
"       </td>",
"       <td>",
"        Generally capable of developing a working alliance with therapist; interested in others despite fear of being hurt; usually capable of self-reflection; may have long-standing relationships and/or be avoidant and prefer to be alone because it feels \"safer\".",
"       </td>",
"       <td>",
"        Less capable of developing a working alliance; generally less interested in others; less capacity for self-reflection.",
"       </td>",
"       <td>",
"        Capable of developing a working alliance.",
"       </td>",
"       <td>",
"        Often less capable of developing a working alliance; pattern of overvaluing/devaluing therapist, provocations and fear of abandonment; may expect others to be less cooperative than dPTSD; often have about the same level of interest in others as in DID; less capacity for self-reflection than in DID; history of tumultuous, chaotic relationships and difficulty tolerating being alone.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Comorbidity",
"        </strong>",
"       </td>",
"       <td>",
"        <p>",
"         Usually meet criteria for multiple comorbid disorders including mood disorders, PTSD and other anxiety disorders, substance disorders, mixed personality disorders, somatoform disorders as well as multiple medical illnesses such as headaches, fibromyalgia, gastrointestinal, and gynecological problems.",
"        </p>",
"        <p>",
"         Usually meet BPD criteria when severely decompensated/having overwhelming PTSD/dissociative disorder symptoms; most do not meet BPD criteria once stabilized.",
"        </p>",
"       </td>",
"       <td>",
"        Typically meet criteria for fewer comorbid conditions although substance disorders are common.",
"       </td>",
"       <td>",
"        Typically meet criteria for fewer comorbid conditions, but comorbid substance abuse is common.",
"       </td>",
"       <td>",
"        Often have a variety of comorbid disorders, but less prevalence of PTSD, somatoform disorders.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     DES: Dissociative Experiences Scale; DID: dissociative identitiy disorder; dPTSD: dissociative subtype of PTSD; PTSD: posttraumatic stress disorder; BPD: borderline personality disorder.",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Brand B, Loewenstein RJ. Dissociative disorders: an overview of assessment, phenomenology and treatment. Psychiatric Times 2010.",
"       </li>",
"       <li>",
"        Brand BL, Armstrong JG, Loewenstein RJ, McNary SW. Personality differences on the Rorschach of dissociative identity disorder, borderline personality disorder and psychotic inpatients. Psychol Trauma 2009; 1:188.",
"       </li>",
"       <li>",
"        Briere J, Weathers FW, Runtz M. Is dissociation a multidimensional construct? Data from the Multiscale Dissociation Inventory. J Traumatic Stress 2005; 18:221.",
"       </li>",
"       <li>",
"        Boon S, Draijer N. The differentiation of patients with MPD or DDNOS from patients with a Cluster B personality disorder. Dissociation 1993; 6:126.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
