var title_f42_58_43951="Clubbing of the fingers";
var content_f42_58_43951=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F52839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F52839&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Clubbing of the fingers",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 321px; height: 316px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In a normal finger, the length of the perpendicular dropped from point A to point B should be greater than a similar line from C to D. In clubbing, the relationships are reversed - that is, the distance C-D is greater than the distance A-B. The other important change is the angle described by A-C-E. In the normal finger this is usually &lt;180 degrees whereas in clubbing it is &gt;180 degrees.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Redrawn from DeRemee RA. Facets of the algorithmic synthesis. In: DeRemee RA, (Ed), Clinical profiles of diffuse interstitial pulmonary disease, Mount Kisco, NY, Futura Publishing Company, Inc, 1990, pp. 9-44.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
